      SELECT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( NOT + col0 BETWEEN ( + col1 ) AND col1 + col0 * 92 );
  - name: tab0

outputs:
  - name: q1123.out
    data: |
      87	21	10
      97	1	99
